import React from "react";

export const AnimeList = ({ animeList }) => {
  return (
    <>
      {animeList
        ? animeList.map((anime, index) => {
            return (
              <div className="card">
                <img
                  src="https://cdn.myanimelist.net/images/anime/1207/128768l.jpg"
                  alt="animeImage"
                />
                <div className="anime-info">
                  <h4>Naruto</h4>
                </div>
              </div>
            );
          })
        : "Not Found"}
    </>
  );
};
